import { Product } from "../types";
import ProductDetails from "./ProductDetails";

interface ProductProps {
  productInfo: Product[];
}

function ProductList(productpageProps: ProductProps) {
  const products = productpageProps.productInfo;

  return (
    <>
      <div>Product page list</div>
      {products.map((productDetails: Product) => {
        return <ProductDetails productInfo={productDetails} />;
      })}
    </>
  );
}

export default ProductList;
